import React from 'react';
import './navbar.css';
import {Link} from 'react-scroll'

const Navbar = () => {
  return (
    <nav className="navbar">
        <Link href="index.html" className="nav_logo">Rudraksha</Link>
        <div className="content">
            Link.content_item
        </div>
        <button className="contact"></button>
    </nav>
  )
}

export default Navbar;
